def if_contains_anagrams(str_list):
    pairs_count = 0
    for i in range(len(str_list)):
        for j in range(i+1, len(str_list)):
            if len(str_list[i]) >= 3 and sorted(str_list[i].lower()) == sorted(str_list[j].lower()):
                pairs_count += 1
    if pairs_count >= 70:
        return True
    else:
        return False
